import{_ as n,M as t,p as s,q as l,R as a,t as e,N as o,a3 as r}from"./framework-dd056dd6.js";const c={},h=r('<h1 id="course-overview" tabindex="-1"><a class="header-anchor" href="#course-overview" aria-hidden="true">#</a> Course Overview</h1><h2 id="course-description" tabindex="-1"><a class="header-anchor" href="#course-description" aria-hidden="true">#</a> Course Description</h2><p>Up to this point you have developed static content and focused on the client side of web development. This course we will expand on that knowledge and focus on creating dynamic web sites and application with the introduction of Server-Side Web Development. Throughout the course you will learn the PHP Scripting Language, the most widely used server-side development language, and MySQL, one of the most widely used, open source relational database management systems. Together you will be able to build dynamic web sites, securely track users interactions, and even create your own APIs.</p><h2 id="course-content" tabindex="-1"><a class="header-anchor" href="#course-content" aria-hidden="true">#</a> Course Content</h2>',4),d={href:"https://imdac.github.io/mtm6405/",target:"_blank",rel:"noopener noreferrer"},u={href:"https://brightspace.algonquincollege.com/",target:"_blank",rel:"noopener noreferrer"},m=r('<h2 id="faculty-information" tabindex="-1"><a class="header-anchor" href="#faculty-information" aria-hidden="true">#</a> Faculty Information</h2><h3 id="professor" tabindex="-1"><a class="header-anchor" href="#professor" aria-hidden="true">#</a> Professor</h3><p><strong>Michael Eisenbraun</strong><br> Email: <a href="mailto:eisenbm@algonquincollege.com">eisenbm@algonquincollege.com</a></p><h3 id="program-coordinator" tabindex="-1"><a class="header-anchor" href="#program-coordinator" aria-hidden="true">#</a> Program Coordinator</h3><p><strong>Katie Tremblay</strong><br> Email: <a href="mailto:tremblk3@algonquincollege.com">tremblk3@algonquincollege.com</a></p><p><strong>Abhay Sharma</strong><br> Email: <a href="mailto:sharmaa@algonquincollege.com">sharmaa@algonquincollege.com</a></p><p><strong>Robert Kingsbury</strong><br> Email: <a href="mailto:kingsbr@algonquincollege.com">kingsbr@algonquincollege.com</a></p><h3 id="student-success-specialist" tabindex="-1"><a class="header-anchor" href="#student-success-specialist" aria-hidden="true">#</a> Student Success Specialist</h3><p><strong>Deborah Buck</strong><br> Email: <a href="mailto:buckd@algonquincollege.com">buckd@algonquincollege.com</a></p><h2 id="workload" tabindex="-1"><a class="header-anchor" href="#workload" aria-hidden="true">#</a> Workload</h2><ul><li>3hrs/week lecture/lab</li><li>1hr/week online</li><li>4hrs/week prep/practice/assignments</li></ul><h2 id="class-times" tabindex="-1"><a class="header-anchor" href="#class-times" aria-hidden="true">#</a> Class Times</h2><p>Wednesdays, 11:30 AM - 2:30 PM</p><h2 id="core-topics" tabindex="-1"><a class="header-anchor" href="#core-topics" aria-hidden="true">#</a> Core Topics</h2><p>We will be covering the following topics throughout the course.</p><ul><li>Creating a Local Development Environment</li><li>Creating Dynamic HTML with PHP</li><li>Creating Dynamic Pages with PHP</li><li>Form Handling with PHP</li><li>SQL Databases</li><li>SQL Queries</li><li>Routing with Laravel</li><li>M.V.C with Laravel</li><li>Authentication with Laravel</li></ul><h2 id="late-policy" tabindex="-1"><a class="header-anchor" href="#late-policy" aria-hidden="true">#</a> Late Policy</h2><p>Any work submitted after the due specified, without prior approval, will receive a <strong>ZERO</strong> for that assignment.</p><h2 id="plagiarism-policy" tabindex="-1"><a class="header-anchor" href="#plagiarism-policy" aria-hidden="true">#</a> Plagiarism Policy</h2><p>Plagiarism is defined as defined as presenting someone else’s work, in whole or in part, as one’s own, and includes the verbal or written submission of another work (for example, ideas, wording, code, graphics, music, and inventions) without crediting that source. This includes all electronic sources (for example, the Internet, television, video, film, and recordings), all print and written sources (for example, books, periodicals, lyrics, government publications, promotional materials, and academic assignments), and all verbal sources (for example, conversations and interviews).</p><p>Plagiarism, whether done deliberately or accidentally, is not allowed. The facilitation of plagiarism, that is, one student sharing his or her work with other students, is also not allowed. All parties caught plagiarizing will receive a <strong>ZERO</strong>.</p>',21);function p(g,f){const i=t("ExternalLinkIcon");return s(),l("div",null,[h,a("p",null,[e("Content for Server-Side Web Development can be found on the official course website "),a("a",d,[e("https://imdac.github.io/mtm6405/"),o(i)]),e(".")]),a("p",null,[e("The official course Learning Management System is "),a("a",u,[e("BrightSpace"),o(i)]),e(".")]),m])}const w=n(c,[["render",p],["__file","index.html.vue"]]);export{w as default};
